Molde redondo de 20cm 
Masa
-175 gr harina
-20gr harina de pistacho ( pistachos bien molidos) 
-65 gr azúcar flor 
-100gr mantequilla 
-1 huevo
Batir la mantequilla con el azúcar flor hasta obtener una crema, luego la harina y los pistachos bien molidos, mezclar hasta obtener una textura arenosa. Luego el huevo una vez esté integrado, nuestra masa está lista, Estirar la masa entre dos papeles de horno y forrar el molde.cortar los excedentes de las orilla, pinchar con un tenedor y llevar al refrigerador por unos 30min 
Precalentar el horno a 170 grados 
Pasados los 30 min hornéanos nuestra masa de tarta por 20min o hasta que esté dorada 
Crema de pistacho 
-100 gr de pistachos 
-15 gr aceite oliva 
-20gr azúcar flor 
Hornear los pistachos unos 7 minutos o hasta que estén dorados, poner en la procesadora y moler muy bien, luego agregar el azúcar flor y el aceite y seguir moliendo hasta que se va a formar una pasta. 
Esta se pone de forma muy pareja sobre la masa de tarta 
Ganache de chocolate 
-180 gr chocolate 60% 
-180 gr crema 
Partir el chocolate en trozos muy pequeños. En una olla calentar la crema, sacar del fuego y agregar el chocolate, mezclar hasta que esté completamente derretido el chocolate dejar enfriar un poco y luego poner sobre la crema de pistachos. Dejar enfriar unas 4 horas antes de servir 
